import styled from 'styled-components';

function CvMakePage() {
	return <ComponentWrapper>CbMakePage</ComponentWrapper>;
}

const ComponentWrapper = styled.div`
	width: 87.72%;
	padding: 0;
	max-width: 1060px;
	margin: 0 auto;
`;

export default CvMakePage;
